PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Angles" ("Id" INTEGER PRIMARY KEY  NOT NULL ,"Designation" VARCHAR(50),"Mass" REAL (10,2),"Area" REAL (10,2),"AXB" VARCHAR,"t" REAL (10,2),"R1" REAL (10,2),"R2" REAL (10,2) DEFAULT (null) ,"Cz" REAL (10,2),"Cy" REAL (10,2),"Tan?" REAL (10,2),"Iz" REAL (10,2),"Iy" REAL (10,2),"Iu(max)" REAL (10,2),"Iv(min)" REAL (10,2),"rz" REAL (10,2),"ry" REAL (10,2),"ru(max)" REAL (10,2),"rv(min)" REAL (10,2),"Zz" REAL (10,2),"Zy" REAL (10,2),"Zpz" REAL (10,2),"Zpy" REAL (10,2),"Source" VARCHAR(100));
CREATE TABLE IF NOT EXISTS "Channels" ("Id" INTEGER PRIMARY KEY  NOT NULL , "Designation" VARCHAR(50), "Mass" REAL (10,2), "Area" REAL (10,2), "D" INTEGER (50), "B" INTEGER (50), "tw" REAL (10,2), "T" REAL (10,2), "FlangeSlope" INTEGER, "R1" REAL (10,2), "R2" REAL (10,2), "Cy" REAL (10,2), "Iz" REAL (10,2), "Iy" REAL (10,2), "rz" REAL (10,2), "ry" REAL (10,2), "Zz" REAL (10,2), "Zy" REAL (10,2), "Zpz" REAL (10,2), "Zpy" REAL (10,2),"Source" VARCHAR(100));
CREATE TABLE IF NOT EXISTS "EqualAngle" ("Id" INTEGER PRIMARY KEY  NOT NULL , "Designation" VARCHAR(50), "Mass" REAL (10,2), "Area" REAL (10,2), "AXB" VARCHAR(50), "t" REAL (10,2), "R1" REAL (10,2), "R2" REAL (10,2), "Cz" REAL (10,2), "Cy" REAL (10,2), "Iz" REAL (10,2), "Iy" REAL (10,2), "Iu(max)" REAL (10,2), "Iv(min)" REAL (10,2), "rz" REAL (10,2), "ry" REAL (10,2), "ru(max)" REAL (10,2), "rv(min)" REAL (10,2), "Zz" REAL (10,2), "Zy" REAL (10,2), "Zpz" REAL (10,2), "Zpy" REAL (10,2),"Source" VARCHAR(100));
CREATE TABLE IF NOT EXISTS "UnequalAngle" ("Id" INTEGER PRIMARY KEY  NOT NULL , "Designation" VARCHAR(50), "Mass" REAL (10,2), "Area" REAL (10,2), "AXB" VARCHAR(50), "t" REAL (10,2), "R1" REAL (10,2), "R2" REAL (10,2), "Cz" REAL (10,2), "Cy" REAL (10,2), "Tan?" REAL (10,2), "Iz" REAL (10,2), "Iy" REAL (10,2), "Iu(max)" REAL (10,2), "Iv(min)" REAL (10,2), "rz" REAL (10,2), "ry" REAL (10,2), "ru(max)" REAL (10,2), "rv(min)" REAL (10,2), "Zz" REAL (10,2), "Zy" REAL (10,2), "Zpz" REAL (10,2), "Zpy" REAL (10,2),"Source" VARCHAR(100));
CREATE TABLE IF NOT EXISTS "Material" (
	"Grade"	TEXT,
	"Yield Stress (< 20)"	INTEGER,
	"Yield Stress (20 -40)"	INTEGER,
	"Yield Stress (> 40)"	INTEGER,
	"Ultimate Tensile Stress"	INTEGER,
	"Elongation "	INTEGER
);
CREATE TABLE IF NOT EXISTS "Bolt" (
	"Bolt_diameter"	TEXT
);
CREATE TABLE IF NOT EXISTS "Columns" (
	`Id`	INTEGER NOT NULL,
	`Designation`	VARCHAR ( 50 ),
	`Mass`	REAL ( 10 , 2 ),
	`Area`	REAL ( 10 , 2 ),
	`D`	REAL ( 10 , 2 ),
	`B`	REAL ( 10 , 2 ),
	`tw`	REAL ( 10 , 2 ),
	`T`	INTEGER ( 10 , 2 ),
	`FlangeSlope`	INTEGER DEFAULT (null),
	`R1`	REAL ( 10 , 2 ),
	`R2`	REAL ( 10 , 2 ),
	`Iz`	REAL ( 10 , 2 ),
	`Iy`	REAL ( 10 , 2 ),
	`rz`	REAL ( 10 , 2 ),
	`ry`	REAL ( 10 , 2 ),
	`Zz`	REAL ( 10 , 2 ),
	`Zy`	REAL ( 10 , 2 ),
	`Zpz`	REAL ( 10 , 2 ),
	`Zpy`	REAL ( 10 , 2 ),
	`Source`	VARCHAR ( 100 ),
	`Type`	TEXT,
	PRIMARY KEY(`Id`)
);
CREATE TABLE IF NOT EXISTS "Beams" (
	`Id`	INTEGER NOT NULL,
	`Designation`	VARCHAR ( 50 ),
	`Mass`	REAL ( 10 , 2 ),
	`Area`	REAL ( 10 , 2 ),
	`D`	REAL ( 10 , 2 ),
	`B`	REAL ( 10 , 2 ),
	`tw`	REAL ( 10 , 2 ),
	`T`	REAL ( 10 , 2 ),
	`FlangeSlope`	INTEGER,
	`R1`	REAL ( 10 , 2 ),
	`R2`	REAL ( 10 , 2 ),
	`Iz`	REAL ( 10 , 2 ),
	`Iy`	REAL ( 10 , 2 ),
	`rz`	REAL ( 10 , 2 ),
	`ry`	REAL ( 10 , 2 ),
	`Zz`	REAL ( 10 , 2 ),
	`Zy`	REAL ( 10 , 2 ),
	`Zpz`	REAL ( 10 , 2 ),
	`Zpy`	REAL ( 10 , 2 ),
	`Source`	VARCHAR ( 100 ),
	`Type`	TEXT,
	PRIMARY KEY(`Id`)
);
CREATE TABLE IF NOT EXISTS "Angle_Pitch" (
	"ID"	INTEGER UNIQUE,
	"Nominal_Leg"	INTEGER,
	"Max_Bolt_Dia"	INTEGER,
	"Bolt_lines"	INTEGER,
	"S1"	INTEGER,
	"S2"	INTEGER,
	"S3"	INTEGER
);
COMMIT;
